const runTestCase = async (caseNum, callback, expectedUri) => {
  let blob = await canvasToPDF((ctx) => {
    drawCase(caseNum, ctx);
  });
  const doc = await window.Core.createDocument(blob, { extension: "pdf" });
  const pageNumber = 1;

  return new Promise((resolve, reject) => {
    doc.loadCanvas({
      pageNumber,
      zoom: 1,
      multiplier: 1,
      drawComplete: async (thumbnail) => {
        const actualURI = thumbnail.toDataURL();

        const isEqual = actualURI === expectedUri;
        console.log("isEqual", isEqual);
        callback(isEqual);
        resolve();
      },
    });
  });
};

const drawCase = (caseNumber, ctx) => {
  switch (caseNumber) {
    case 1:
      ctx.lineWidth = 30;
      ctx.rect(100, 100, 200, 160);

      ctx.save();
      ctx.strokeStyle = "red";

      ctx.stroke();
      ctx.fill();
      ctx.restore();
      break;
    case 2:
      ctx.lineWidth = 30;
      ctx.rect(100, 100, 200, 160);

      ctx.strokeStyle = "orange";

      ctx.save();
      ctx.strokeStyle = "red";
      ctx.rect(50, 50, 200, 160);

      ctx.restore();

      ctx.stroke();
      ctx.fill();
      break;
    case 3:
      ctx.lineWidth = 30;

      ctx.strokeStyle = "orange";
      ctx.rect(200, 200, 300, 300);

      ctx.stroke();
      ctx.fillRect(100, 100, 200, 160);

      break;
    case 4:
      ctx.lineWidth = 30;
      ctx.rect(100, 100, 200, 160);

      ctx.strokeStyle = "red";
      ctx.fill();
      ctx.stroke();

      ctx.clearRect(100, 100, 200, 160);

      break;
    case 5:
      ctx.lineWidth = 30;

      ctx.strokeStyle = "orange";
      ctx.rect(200, 200, 300, 300);

      ctx.strokeRect(100, 100, 200, 160);

      break;
    case 6:
      ctx.lineWidth = 20;

      ctx.strokeStyle = "orange";
      ctx.rect(200, 200, 300, 200);

      ctx.moveTo(50, 80);
      ctx.lineTo(100, 300);

      ctx.stroke();

      break;
    case 7:
      ctx.lineWidth = 20;

      ctx.strokeStyle = "orange";
      ctx.rect(200, 200, 300, 200);

      ctx.stroke();
      ctx.moveTo(50, 80);
      ctx.lineTo(100, 300);
      break;
    case 8:
      ctx.lineWidth = 20;

      ctx.strokeStyle = "orange";

      ctx.arc(100, 100, 50, 0, 2 * Math.PI);
      ctx.stroke();
      break;
    case 9:
      ctx.lineWidth = 20;

      ctx.strokeStyle = "orange";
      ctx.rect(200, 200, 300, 200);
      ctx.arc(100, 100, 50, 0, 2 * Math.PI);
      // ctx.rect(200, 200, 300, 200);
      ctx.stroke();
      break;
    case 10:
      ctx.fillText("text", 10, 30);
      break;

    case 11:
      ctx.fillStyle = "red";
      ctx.fillText("text", 10, 30);

      break;

    case 12:
      ctx.fillStyle = "red";
      ctx.fillText("text", 10, 30);

      ctx.fillRect(40, 40, 20, 20);
      break;
    case 13:
      ctx.fillStyle = "red";
      ctx.strokeStyle = "blue";
      ctx.fillText("text", 10, 30);
      ctx.stroke();

      break;

    case 14:
      ctx.fillStyle = "red";
      ctx.strokeStyle = "blue";
      ctx.fillText("text", 10, 30);
      ctx.strokeText("stroke", 50, 50);

      break;

    case 15:
      ctx.beginPath();
      ctx.arc(100, 75, 50, 0, Math.PI * 2);
      ctx.clip();

      ctx.fillStyle = "blue";
      ctx.fillRect(0, 0, 200, 200);
      ctx.fillStyle = "orange";
      ctx.fillRect(0, 0, 100, 100);

      break;
    case 16:
      ctx.beginPath();
      ctx.fillStyle = "orange";
      ctx.strokeStyle = "green";
      ctx.arc(100, 120, 50, 0, 2 * Math.PI, false);
      ctx.stroke();
      ctx.fill();

      ctx.font = "bold 12px Arimo-Bold";
      ctx.textAlign = "center";
      ctx.fillStyle = "blue";
      ctx.fillText("10", 100, 120);

      break;

    case 17:
      ctx.beginPath();
      ctx.strokeStyle = "blue";
      ctx.moveTo(20, 20);
      ctx.lineTo(200, 20);
      ctx.stroke();

      // Second path
      ctx.beginPath();
      ctx.strokeStyle = "green";
      ctx.moveTo(20, 20);
      ctx.lineTo(120, 120);
      ctx.stroke();

      break;

    case 18:
      ctx.lineWidth = 20;

      ctx.strokeStyle = "orange";
      ctx.rect(200, 200, 300, 200);

      ctx.beginPath();
      ctx.arc(100, 100, 50, 0, 2 * Math.PI);

      ctx.stroke();

      break;
    case 19:
      ctx.scale(9, 3);
      ctx.fillStyle = "red";
      ctx.fillRect(10, 10, 8, 20);

      break;
    case 20:
      ctx.rotate((45 * Math.PI) / 180);
      ctx.fillStyle = "red";
      ctx.fillRect(100, 0, 80, 20);

      break;

    case 21:
      ctx.fillRect(10, 10, 100, 50);
      ctx.translate(70, 70);
      ctx.fillRect(10, 10, 100, 50);

      break;
    case 22:
      // Define the points as {x, y}
      let start = { x: 50, y: 20 };
      let cp1 = { x: 230, y: 30 };
      let cp2 = { x: 150, y: 80 };
      let end = { x: 250, y: 100 };

      // Cubic Bézier curve
      ctx.beginPath();
      ctx.moveTo(start.x, start.y);
      ctx.bezierCurveTo(cp1.x, cp1.y, cp2.x, cp2.y, end.x, end.y);
      ctx.stroke();

      // Start and end points
      ctx.fillStyle = "blue";
      ctx.beginPath();
      ctx.arc(start.x, start.y, 5, 0, 2 * Math.PI); // Start point
      ctx.arc(end.x, end.y, 5, 0, 2 * Math.PI); // End point
      ctx.fill();

      // Control points
      ctx.fillStyle = "red";
      ctx.beginPath();
      ctx.arc(cp1.x, cp1.y, 5, 0, 2 * Math.PI); // Control point one
      ctx.arc(cp2.x, cp2.y, 5, 0, 2 * Math.PI); // Control point two
      ctx.fill();

      break;
    case 23:
      // Define the points as {x, y}
      ctx.beginPath();
      ctx.moveTo(50, 20);
      ctx.quadraticCurveTo(230, 30, 50, 100);
      ctx.stroke();

      // Start and end points
      ctx.fillStyle = "blue";
      ctx.beginPath();
      ctx.arc(50, 20, 5, 0, 2 * Math.PI); // Start point
      ctx.arc(50, 100, 5, 0, 2 * Math.PI); // End point
      ctx.fill();

      // Control point
      ctx.fillStyle = "red";
      ctx.beginPath();
      ctx.arc(230, 30, 5, 0, 2 * Math.PI);
      ctx.fill();

      break;

    case 24:
      var grd = ctx.createLinearGradient(0, 0, 170, 0);
      grd.addColorStop(0, "black");
      grd.addColorStop(1, "white");

      ctx.fillStyle = grd;
      ctx.fillRect(20, 20, 150, 100);
      ctx.fill();

      break;

    case 25:
      var gradient = ctx.createRadialGradient(110, 90, 30, 100, 100, 70);
      gradient.addColorStop(0, "pink");
      gradient.addColorStop(0.9, "white");
      gradient.addColorStop(1, "green");

      ctx.fillStyle = gradient;
      ctx.fillRect(20, 20, 160, 160);

      break;
    case 26:
      var txt = "Hello World";
      ctx.fillText("width:" + ctx.measureText(txt).width, 10, 50);
      ctx.fillText(txt, 10, 100);

      break;
    case 27:
      let _width = 200;
      let _height = 100;

      let X = 0;
      let Y = 0;

      ctx.save();

      ctx.beginPath();
      ctx.arc(
        _width * 0.5,
        _height * 0.5,
        Math.max(_height * 0.5, 0),
        0,
        Math.PI * 2,
        false
      );
      ctx.closePath();
      ctx.restore();
      ctx.clip();

      ctx.stroke();

      const hatchSize = 10;
      const hatchLineWidth = 1;
      ctx.lineWidth = hatchLineWidth;

      // horizontal lines
      for (let i = Y; i < Y + _height; i += hatchSize) {
        ctx.beginPath();
        ctx.moveTo(X, i);
        ctx.lineTo(X + _width, i);
        ctx.stroke();
      }

      for (let i = X; i < X + _width; i += hatchSize) {
        ctx.beginPath();
        ctx.moveTo(i, Y);
        ctx.lineTo(i, Y + _height);
        ctx.stroke();
      }

      break;
    case 28:
      ctx.save();
      ctx.translate(300, 300);

      ctx.fillRect(100, 100, 200, 150);

      ctx.restore();
      break;
    case 29:
      ctx.save();
      ctx.translate(300, 300);

      ctx.arc(10, 10, 50, 0, Math.PI * 2, false);

      ctx.stroke();
      break;
    case 30:
      ctx.font = "30px Arial";
      ctx.fillText("Hello World", 10, 50);
      break;

    case 31:
      ctx.font = "20px Times-Roman";
      ctx.fillText("Hello World", 10, 50);
      break;
    case 32:
      drawTigerAnnotation(ctx);
      break;
    case 33:
      ctx.lineWidth = 0.2;
      ctx.rect(100, 100, 200, 160);

      ctx.strokeStyle = "red";

      ctx.stroke();
      break;
    case 34:
      ctx.lineWidth = 30;
      ctx.rect(100, 100, 200, 160);

      ctx.strokeStyle = "red";
      ctx.lineWidth = ctx.lineWidth * 2.5;
      ctx.stroke();
      ctx.fill();
      break;
  }
};

